export function mapSvgIcon(text: string): React.ReactNode {
  for (const svg of svgs) {
    if (svg.name.toLocaleLowerCase() === text.toLocaleLowerCase()) {
      return svg.svg
    }
  }

  return mapSvgIconGeneral(text)
}

export function mapSvgIconGeneral(text: string): React.ReactNode {
  if (text.toLocaleLowerCase().indexOf("api") != -1) {
    const apiSvg = svgs.find(svg => svg.name.toLowerCase() === "api");
    return apiSvg ? apiSvg.svg : undefined;
  } else if (text.toLocaleLowerCase().indexOf("algorithm") != -1 || text.toLocaleLowerCase().indexOf("machine") != -1) {
    const algorithmSVG = svgs.find(svg => svg.name.toLocaleLowerCase() === 'computer')
    return algorithmSVG ? algorithmSVG.svg : undefined
  }
}

export function getSource(name: string) {
  const svg = svgs.find(svg => svg.name.toLowerCase() === name.toLowerCase())?.source
  return svg;
}